description:
Accu-feel v2.1 latest version November 2015.

supports prepar3d v3



after installing, you must do this:

Below Entries are REQUIRED to be entered manually in DLL.XML file located in 
%AppData%Lockheed MartinPrepar3D v3 


copy and paste it right before this line (at the bottom): &lt;/SimBase.Document&gt;




  &lt;Launch.Addon&gt;
        &lt;Name&gt;A2A Feel&lt;/Name&gt;
        &lt;Disabled&gt;False&lt;/Disabled&gt;
        &lt;Path&gt;ModulesA2A_Feel.dll&lt;/Path&gt;
        &lt;DllStartName&gt;module_init&lt;/DllStartName&gt;
        &lt;DllStopName&gt;module_deinit&lt;/DllStopName&gt;
    &lt;/Launch.Addon&gt;
  &lt;Launch.Addon&gt;
        &lt;Name&gt;AccuFeelMenu&lt;/Name&gt;
        &lt;Disabled&gt;False&lt;/Disabled&gt;
        &lt;ManualLoad&gt;False&lt;/ManualLoad&gt;
        &lt;Path&gt;ModulesAccuFeelMenu.dll&lt;/Path&gt;
    &lt;/Launch.Addon&gt;
